import React from "react";
import Common from "./Common";

const Home = () => {
  return (
    <>
      <Common
        name="Grow your business with"
        visit="/service"
        imgsrc="https://bootstrapmade.com/demo/templates/HeroBiz/assets/img/hero-carousel/hero-carousel-3.svg"
        btname="Get Started"
      />
    </>
  );
};

export default Home;
